import React from 'react';
import './App.css';
import {connect} from "react-redux";
import {setName1Action} from "./actions/actions";

const App = props => {
    console.log(props.setName1);
 return (
     <div className="App">
      <div>
       <label>Player 1: </label>
       <input type="text" />
      </div>
      <div>
       <label>Player 2: </label>
       <input type="text" />
      </div>

      <div style={{ marginTop: 30 }}>
       <p>P1 name:</p>
       <p>P2 name:</p>
      </div>
     </div>
 )
};

const mapStateToProps = (state) => ({
    setName1: state.setName1Reducer,
    setName2: state.setName2Reducer
});

const mapDispatchToProps = (dispatch) => ({
    generateName1: () => dispatch(setName1Action()),
    generateName2: () => dispatch(setName2Action())
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
